import { useNavigate } from "react-router-dom";

export default function Header() {
    const navigate = useNavigate();

    function Navigate() {
        navigate(-1);
    }

    return (
        <>
                <header className="header">
                    <p>CINEFLEX</p>
                </header>
        </>
    );
}
